import React, {Component} from 'react'
import { JsonToTable } from "react-json-to-table";

class DisplayTable extends Component {
    retrievedSectionInfo;

    componentDidMount() {
        this.intervalID = setInterval(this.getData.bind(this), 1000);
    }

    componentWillUnmount() {
        clearInterval(this.intervalID)
    }

    getData = () => {
        retrievedSectionInfo = localStorage.getItem('sectionInfo');
    }

    render() {
        var jsonObject = JSON.parse(retrievedSectionInfo)
        return (  
            <div className="displayTable">
                <JsonToTable json={jsonObject} />
            </div>
        )
    }
}
    
export default DisplayTable
